import React from 'react';
import { Test } from './components/Test';
import { AppBar } from './components/AppBar';
import { Route, Switch, Redirect } from 'react-router-dom';

export const Routes = () => {
  return (
    <div>
      <AppBar />
      <Switch>

        <Route exact path="/Test" component={Test} />
      </Switch>
    </div>
  );
};
